import { RenderAfterNavermapsLoaded, NaverMap } from "react-naver-maps";

function App() {
  return (
    <NaverMap
      id="maps-examples-map-simple"
      style={{
        width: "100%",
        height: "600px",
      }}
    />
  );
}

// render
<RenderAfterNavermapsLoaded ncpClientId={"pg43l9dp5c"}>
  <App />
</RenderAfterNavermapsLoaded>;

export default App;
